namespace Coba_Hackerrank;

public class Program
{
    static void Main()
    {
        string s =
            "";
        int k = 621;
        
        string hasil = findSubstring( s, k );
        Console.WriteLine(hasil);
    }
    
    public static string findSubstring(string s, int k)
    {
        string vowels = "aiueo";
        int bestCount = 0;
        int count = 0;
        string result = "";
        string tempStr = "";
        int indexNow = 0;
        for( int i = 0; i < s.Length; i++ )
        {   
            string letter = s[i].ToString();
            tempStr += letter;
            if ( vowels.Contains( letter ) )
            {
                count++;
            } 
            
            TempStr(k, ref tempStr, ref count, ref bestCount, ref result, ref indexNow, ref i);
        }
        
        if(bestCount == 0)
        {
            result = "Not found!";
        }

        return result;
    }

    private static void TempStr(int k, ref string tempStr, ref int count, ref int bestCount, ref string result,
        ref int indexNow, ref int i)
    {
        if (tempStr.Length <= k)
        {
            if (count > bestCount)
            {
                bestCount = count;
                result = tempStr;
            }
        }
        else
        {
            count = 0;
            tempStr = "";
            indexNow++;
            i = indexNow - 1;
        }
    }
}